import logo from './logo.svg';
import './App.css';
import Header from "./Header/Header";
import News from "./News/News";

function App() {
    const news = [
        { title: '–ó–∞–≥–æ–ª–æ–≤–æ–∫ –Ω–æ–≤–æ—Å—Ç–∏ 1', description: '‚ö° –ó–∞–ª–µ—Ç–∞–µ–º —Å –∞–Ω–æ–Ω—Å–æ–º –Ω–∞—à–µ–≥–æ –Ω–æ–≤–æ–≥–æ —Å–æ—Å—Ç–∞–≤–∞ –ø–æ CS:GO ‚ö°\n' +
                '\n' +
                'üí• –ü–æ–ø—Ä–∏–≤–µ—Ç—Å—Ç–≤—É–π—Ç–µ –Ω–∞—à–∏—Ö —Ä–µ–±—è—Ç –∏ –¥–∞–≤–∞–π—Ç–µ –ø–æ–∂–µ–ª–∞–µ–º –∏–º –∑–∞–≤–æ–µ–≤–∞—Ç—å –∫–∞–∫ –º–æ–∂–Ω–æ –±–æ–ª—å—à–µ —Ç–∏—Ç—É–ª–æ–≤ –≤–º–µ—Å—Ç–µ üí•\n' +
                '\n' +
                'üèÖ –ü–∞–≤–µ–ª waterzy page –ë–∞—Ä–∞—à–∫–æ–≤\n' +
                'üèÖ –≠–¥–≤–∞—Ä–¥ Kaide –¢–∞—Ç–∞—Ä–∏–Ω–æ–≤\n' +
                'üèÖ –†—É—Å–ª–∞–Ω Magickst –ì–∞—Ñ–∏–µ–≤\n' +
                'üèÖ –ò–ª—å—è 1ll –í–æ—Ä–æ–Ω–æ–≤\n' +
                'üèÖ –†–µ–Ω–∞—Ç SUROVIY666 –ê–±–¥—Ä–∞—Ö–º–∞–Ω–æ–≤' },
        // –î–æ–±–∞–≤—å—Ç–µ –¥—Ä—É–≥–∏–µ –Ω–æ–≤–æ—Å—Ç–∏ –≤ –º–∞—Å—Å–∏–≤
    ];
  return (
    <div className="App">
        <body>
        <Header />
        <News news={news}/>

        </body>
    </div>
  );
}

export default App;
